import React from 'react';
import Iframe from "../Tools/Iframe";
import "../stylesheets/Home.css"
import { Link } from 'react-scroll'
import ScrollTrigger from "react-scroll-trigger";

class Home extends React.Component {

    onClickHandler = () => {
        this.props.changePage("about")
    }

    changePageEnter = (page) => {
        this.props.changePage("home")
    }

    changePageExit = () => {
        this.props.changePage("about")
    }

    render() {
        return (
            <>

                <ScrollTrigger
                    onEnter={this.changePageEnter}
                    onExit={this.changePageExit}>
                </ScrollTrigger>
                <Iframe id="home-iframe" title="galaxy" source={"https://www.bengarlock.com:6323/"} />

                <div id="welcome-box">
                    <div id="welcome-text">
                        <p id="hello-text">Hello.</p>
                        <div id="my-name-is">
                            <p><span> My name is </span><span id="full-name"> Ben Garlock.</span></p>
                            <p>I'm a full-stack web developer.</p>
                        </div>

                        <Link to="about" smooth={true} spy={true} duration={1000}>
                            <p id="my-portfolio-button" onClick={this.onClickHandler}>Enter</p>
                        </Link>
                    </div>
                </div>

            </>
        );
    }


};

export default Home;
